INSERT INTO `web_home_config` VALUES (3,'abbreviation','至尊娱乐','简称',1504679233),(4,'title','至尊娱乐','网站标题',1504679233),(5,'phone','','联系方式',1504679252),(6,'address','','公司地址',1504679272),(7,'beian','','公司备案信息',1504679295),(8,'desc','至尊娱乐有限公司，该公司是一家长期专注于定制开发特色棋牌游戏、手机棋牌游戏、捕鱼游戏等等的高新科技游戏软件开发公司，力求打造“专业化、国际化、产业化、品牌化”的高科技游戏软件产品，成为独具魅力的领跑者。 集结了一群年轻而充满梦想与激情的游戏从业人员，团队核心成员均来自腾讯、中青宝、博雅互动等一线棋牌游戏开发公司，具有五年以上棋牌游戏研发经验，自公司成立以来，始终秉承“诚为本、技至精”的核心经营理念，不断钻研市场需求，不断打磨产品品质，与中手游、百度、91等众多知名互联网企业精诚合作，并取得了丰硕的成果。由至尊娱乐一手打造的房卡金币双模式棋牌游戏平台，铸就了大量网络棋牌游戏行业的成功案例。 在不断优化自身产品的同时，至尊娱乐将推出更多适应市场的运营级游戏产品和平台，凭借自身丰富的资源优势，成熟的经验优势，强大的技术优势，优质的服务优势，更好的为客户创造独特价值。','公司介绍',1504679361),(9,'email','','邮箱',1504679958),(10,'qq','','qq',1504679970);
